import numpy as np
from scipy import stats

# Costruiamo la matrice di contingenza 2x2.
# La struttura della matrice Ã¨:
#           Successi | Fallimenti
# Gruppo 1      a     |      b
# Gruppo 2      c     |      d

# Calcoliamo i valori per la matrice:
successi_gruppo1 = 12
fallimenti_gruppo1 = 12 - successi_gruppo1  # 3

successi_gruppo2 = 12
fallimenti_gruppo2 = 12 - successi_gruppo2  # 6

# Definiamo la matrice di contingenza
table = np.array([
    [successi_gruppo1, fallimenti_gruppo1],
    [successi_gruppo2, fallimenti_gruppo2]
])

# --- Esecuzione del Test ---
# Eseguiamo il test esatto di Fisher.
# L'alternativa 'two-sided' (a due code) verifica se le proporzioni
# sono semplicemente diverse, senza specificare una direzione.
oddsratio, p_value = stats.fisher_exact(table, alternative='two-sided')

# --- Interpretazione dei Risultati ---
# Impostiamo la soglia di errore (livello di significativitÃ  alpha)
# come richiesto.
alpha = 1/12

print("--- Risultati del Test Esatto di Fisher ---")
print(f"Matrice di Contingenza:\n{table}")
print(f"\nOdds Ratio: {oddsratio:.4f}")
print(f"P-value: {p_value:.4f}")
print(f"Soglia di significativitÃ  (alpha): {alpha:.4f}")

print("\n--- Interpretazione ---")
# Confrontiamo il p-value con la nostra soglia alpha
if p_value < alpha:
    print(f"â Conclusione: Dato che il p-value ({p_value:.4f}) Ã¨ MINORE della soglia alpha ({alpha:.4f}), rifiutiamo l'ipotesi nulla.")
    print("C'Ã¨ una differenza statisticamente significativa tra le proporzioni di successo dei due gruppi.")
else:
    print(f"â Conclusione: Dato che il p-value ({p_value:.4f}) NON Ã¨ minore della soglia alpha ({alpha:.4f}), non possiamo rifiutare l'ipotesi nulla.")
    print("Non c'Ã¨ evidenza sufficiente per concludere che esista una differenza statisticamente significativa tra i due gruppi.")

