"""# Possiamo applicare il T-Test?
La risposta la dÃ  il Test di Shapiro-Wilk, che verifica se i tempi di esecuzione seguono una distribuzione normale. Se lo fanno applichiamo il T-Test, se non lo fanno applichiamo il T-Test lo stesso (bruh)
"""

import pandas as pd
import numpy as np
from scipy import stats
import matplotlib.pyplot as plt
import statsmodels.api as sm # Spesso usato per Q-Q plot piÃ¹ dettagliati

# Task 1 - S1
x = ['00:03', '00:12', '00:33', '00:22', '00:07', '00:04', '00:05',  '00:12', '00:12', '00:40', '00:09', '00:09']
y = ['00:06', '00:06', '00:12', '00:21', '00:25', '00:03', '00:05', '00:08', '01:16', '00:15', '00:10', '00:05']


# TASK 2 - S1
#x = ['00:14', '00:33', '00:23', '00:12', '00:36', '00:05', '00:12', '00:10', '00:15', '01:33', '00:10', '00:06']
#y = ['00:03', '00:24', '00:21', '00:09', '00:12', '00:08', '00:10', '00:13', '00:10', '00:26', '00:13', '00:26']

x_seconds = [to_seconds(t) for t in x]
y_seconds = [to_seconds(t) for t in y]

df = pd.DataFrame({
    'Obsidian': x_seconds,
    'Notion': y_seconds
})


# --- Il tuo codice (che Ã¨ giÃ  perfetto) ---
# Calcola le differenze tra le coppie di osservazioni
differences = df['Obsidian'] - df['Notion']

# Esegue il test di Shapiro-Wilk sulle differenze
shapiro_stat, shapiro_p_value = stats.shapiro(differences)

print("--- Test di Shapiro-Wilk (sulle Differenze) ---")
print(f"Statistica W: {shapiro_stat:.4f}")
print(f"P-value: {shapiro_p_value:.4f}")

# Interpretazione del Test di Shapiro-Wilk
alpha_shapiro = 0.05 # Livello di significativitÃ  per il test di normalitÃ 

print("\n--- Interpretazione del Test di Shapiro-Wilk ---")
if shapiro_p_value < alpha_shapiro:
    print(f"Conclusione Shapiro-Wilk: Dato che p ({shapiro_p_value:.4f}) Ã¨ minore di {alpha_shapiro}, rifiutiamo l'ipotesi nulla.")
    print("âLe differenze *non* sembrano essere distribuite normalmente.")
    print("Attenzione: L'assunzione di normalitÃ  per il t-test accoppiato potrebbe non essere soddisfatta. Potrebbe essere necessario considerare test non parametrici (es. Wilcoxon Signed-Rank Test) o verificare la robustezza del t-test per la dimensione del campione.")
else:
    print(f"Conclusione Shapiro-Wilk: Dato che p ({shapiro_p_value:.4f}) non Ã¨ minore di {alpha_shapiro}, non abbiamo sufficiente evidenza per rifiutare l'ipotesi nulla.")
    print("â Le differenze *possono essere considerate* distribuite normalmente.")
    print("L'assunzione di normalitÃ  per il t-test accoppiato puÃ² essere soddisfatta.")


# --- NUOVO: Aggiunta del Q-Q Plot per ispezione visiva ---
print("\n--- Ispezione Visiva con Q-Q Plot ---")

fig = sm.qqplot(differences, line='s') # 's' sta per 'standardized line'
plt.xlabel("Quantili Teorici (Normali)")
plt.ylabel("Quantili del Campione")
plt.grid(True)
plt.show()

print("Interpretazione del Q-Q Plot:")
print("Se i punti blu seguono da vicino la linea rossa, i dati sono probabilmente normali.")
print("Se i punti deviano sistematicamente dalla linea (specialmente alle code), i dati non sono normali.")

