bars_booking = ax.bar(indices - bar_width/2, df['Obsidian'], bar_width, label='Obsidian', color='cornflowerblue')
bars_airbnb = ax.bar(indices + bar_width/2, df['Notion'], bar_width, label='Notion', color='darkorange')

